(*Instantiate the test runner*)
testRunner(
	Id := 50,
	Name := 'assertGreater_BYTE',
    RunTests := GVL.RunAll,
	ResetTests := GVL.ResetAll,
	TestCases:=vTestCases);

(*Report the results to the collection global*)
GVL.Results[testRunner.Id] := testRunner.Summary;

(*Reset totals*)
FOR i:=0 TO 4 DO
	GVL.Totals[i] := 0;
END_FOR

(*Count totals*)
FOR i:=0 TO 500 DO
	IF GVL.Results[i].Id > 0 THEN
		(*Count existing POUs under test*)
		GVL.Totals[0] := GVL.Totals[0] + 1;
		(*Count the pass rate. Needs to be divided in the end by the number of total tests*)
		GVL.Totals[1] := GVL.Totals[1] + REAL_TO_UINT(GVL.Results[i].PassRate);
		(*Count the number of tests*)
		GVL.Totals[2] := GVL.Totals[2] + GVL.Results[i].TotalTests;
		(*Count the number of tests passed*)
		GVL.Totals[3] := GVL.Totals[3] + GVL.Results[i].TestsPassed;
		(*Count the number of tests failed*)
		GVL.Totals[4] := GVL.Totals[4] + GVL.Results[i].TestsFailed;
	END_IF
END_FOR
GVL.Totals[1] := GVL.Totals[1] / GVL.Totals[0];
